Having regard to the Treaty establishing the European Community,
Having regard to Council Regulation (EC) No 2178/95 (1) of 8 August 1995, opening and providing for the administration of Community tariff quotas and ceilings for certain industrial and fishery products originating in Estonia, Latvia and Lithuania, and establishing the detailed provisions for adapting these quotas and ceilings, extended by Regulation (EC) No 921/96 (2), and in particular Article 3 (3) thereof,
Whereas, pursuant to Article 1 of that Regulation, Estonia, Latvia and Lithuania should benefit from preferential tariff arrangements, in particular subject to tariff ceilings; whereas Article 3 (3) provides that once the ceilings are reached the Commission may adopt a regulation to reintroduce the levying of the customs duties actually applied vis-Ă -vis third countries until the end of the calendar year;
Whereas imports of the products specified in the Annex to this Regulation originating in Lithuania and eligible for tariff preferences have been charged against the ceiling up to the total amount; whereas the situation on the Community market for these products requires the reintroduction of customs duties vis-Ă -vis the country in question;
Whereas the levying of customs duties for these products should therefore be reintroduced,
